import React, { Component } from 'react';
import './button-styles.css';

class Button extends Component {

  render() {
    return (
      <div
        style={{ width: '100px', height: '100px' }}
        className="button col-md-1 d-inline-block d-flex justify-content-center align-items-center bg-light text-dark border"
      >
        {this.props.children}
      </div>
    );
  }
}

export default Button;
